/* model version */
#define NNOM_MODEL_VERSION (10000*0 + 100*4 + 0)

/* nnom model */
static nnom_model_t* nnom_model_create(void)
{
	static nnom_model_t model;
	nnom_layer_t ** layer = malloc(sizeof(nnom_layer_t *)*36);
	if(NULL == layer) return NULL;

	check_model_version(NNOM_MODEL_VERSION);
	new_model(&model);

	layer[0] = input_s(&input_1_config);
	layer[1] = model.hook(conv2d_s(&conv2d_config), layer[0]);
	layer[2] = model.active(act_relu(), layer[1]);
	layer[3] = model.hook(maxpool_s(&max_pooling2d_config), layer[2]);
	layer[4] = model.hook(conv2d_s(&conv2d_1_config), layer[3]);
	layer[5] = model.active(act_relu(), layer[4]);
	layer[6] = model.mergex(concat_s(&concatenate_config), 2 ,layer[3] ,layer[5]);
	layer[7] = model.hook(conv2d_s(&conv2d_2_config), layer[6]);
	layer[8] = model.active(act_relu(), layer[7]);
	layer[9] = model.mergex(concat_s(&concatenate_1_config), 3 ,layer[3] ,layer[5] ,layer[8]);
	layer[10] = model.hook(conv2d_s(&conv2d_3_config), layer[9]);
	layer[11] = model.active(act_relu(), layer[10]);
	layer[12] = model.mergex(concat_s(&concatenate_2_config), 4 ,layer[3] ,layer[5] ,layer[8] ,layer[11]);
	layer[13] = model.hook(conv2d_s(&conv2d_4_config), layer[12]);
	layer[14] = model.active(act_relu(), layer[13]);
	layer[15] = model.mergex(concat_s(&concatenate_3_config), 5 ,layer[3] ,layer[5] ,layer[8] ,layer[11] ,layer[14]);
	layer[16] = model.hook(conv2d_s(&conv2d_5_config), layer[15]);
	layer[17] = model.active(act_relu(), layer[16]);
	layer[18] = model.hook(maxpool_s(&max_pooling2d_1_config), layer[17]);
	layer[19] = model.hook(conv2d_s(&conv2d_6_config), layer[18]);
	layer[20] = model.active(act_relu(), layer[19]);
	layer[21] = model.mergex(concat_s(&concatenate_4_config), 2 ,layer[18] ,layer[20]);
	layer[22] = model.hook(conv2d_s(&conv2d_7_config), layer[21]);
	layer[23] = model.active(act_relu(), layer[22]);
	layer[24] = model.mergex(concat_s(&concatenate_5_config), 3 ,layer[18] ,layer[20] ,layer[23]);
	layer[25] = model.hook(conv2d_s(&conv2d_8_config), layer[24]);
	layer[26] = model.active(act_relu(), layer[25]);
	layer[27] = model.mergex(concat_s(&concatenate_6_config), 4 ,layer[18] ,layer[20] ,layer[23] ,layer[26]);
	layer[28] = model.hook(conv2d_s(&conv2d_9_config), layer[27]);
	layer[29] = model.active(act_relu(), layer[28]);
	layer[30] = model.mergex(concat_s(&concatenate_7_config), 5 ,layer[18] ,layer[20] ,layer[23] ,layer[26] ,layer[29]);
	layer[31] = model.hook(conv2d_s(&conv2d_10_config), layer[30]);
	layer[32] = model.hook(flatten_s(&flatten_config), layer[31]);
	layer[33] = model.hook(dense_s(&dense_config), layer[32]);
	layer[34] = model.hook(softmax_s(&softmax_config), layer[33]);
	layer[35] = model.hook(output_s(&output_config), layer[34]);
	model_compile(&model, layer[0], layer[35]);
	free(layer);
	return &model;
}
